  return (
    <Grid container direction="column">
       <Grid item>
        <Header />
      </Grid>
      <Grid item>
        <div style={{
          fontSize : '30px',
        }}>
          <p>CA TECH CHALLENGE STORE</p>
        </div>
      </Grid>

      <Grid item>
        <Content />
      </Grid>

    </Grid>

  );
}

export default App;
